import React, { useState } from 'react'
import data from '../../data/data.json'
export default function Skill() {
    const [skilSet, setskilSet] = useState<Array<string>>(['HTML', 'CSS', 'React'])
    return (
        <div>
            <h1>
                Skills
            </h1>
            <ul>
                {skilSet.map((MapSkil: string) => {
                    return (
                        <li>{MapSkil}</li>
                    )
                })}
            </ul>
        </div>
    )
}
